import React from 'react'
import { useState } from 'react'
import axios from 'axios';
import {useNavigate} from "react-router-dom";

export default function Inscritpion() {
  const [fullname, setfullname] = useState("");
  const [email, setemail] = useState("");
  const [password, setpassword] = useState("");

  const navigate = useNavigate();

  const valueFullname = (event)=>{
    setfullname(event.target.value);
  }

  const valueEmail = (event)=>{
    setemail(event.target.value);
  }

  const valuePassword = (event)=>{
    setpassword(event.target.value);
  }

  const handleSubmit = (event) =>{
    event.preventDefault();

    const user = {fullname,email,password};
    axios.post("http://localhost:5000/user/register",user)
    .then((resultat)=>{navigate("/connexion");})
    .catch((erreur)=>{console.log(erreur)});
  }

  return (
    <div>
        <form onSubmit={handleSubmit}>
            <input type="text" placeholder="fullname" value={fullname} onChange={valueFullname}/>
            <input type="text" placeholder="email" value={email} onChange={valueEmail}/>
            <input type="password" placeholder="password" value={password} onChange={valuePassword}/>
            <button>valider</button>
        </form>
    </div>
  )
}
